import { useState } from "react";
import BlogList from "./BlogList";

const Home = () => {
  const [blogs, setBlogs] = useState([
    { title: 'Digital Transformation', body: 'Digitizing and optimizing internal processes to increase efficiency, reduce costs, and improve productivity. This often involves automation of repetitive tasks, digitization of paperwork, and implementation of digital workflows using Amazon Web Services, Google Cloud Platform, Microsoft Azure.', author: 'Digital', id: 3 },
    { title: 'Snowflake', body: 'lorem ipsum...', author: 'azure', id: 3 },
    { title: 'Web dev top tips', body: 'lorem ipsum...', author: 'Snowflake', id: 3 },
    { title: 'Web dev top tips', body: 'lorem ipsum...', author: 'ELK Stack', id: 3 },
    { title: 'Microservices', body: 'lorem ipsum...', author: 'Java', id: 3 },
    { title: 'AL/ML', body: 'lorem ipsum...', author: 'AI', id: 3 },
    { title: 'Database Migration to Cloud', body: 'lorem ipsum...', author: 'DB', id: 3 }
  ])

  return (
    <div className="home">
      <BlogList blogs={blogs.filter(blog => blog.author === 'Digital')} title="Digital Transformation" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'Snowflake')} title="Snowflake" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'ELK Stack')} title="Elastic Search, Logestic, Kibana" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'Java')} title="Microservices Development" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'AI')} title="Artificial Inteligent / Machine Learning / Data Lake" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'DB')} title="Database Migration to Cloud" />
    </div>
  );
}

export default Home;
